import React from 'react'

const Chatbox = () => {
    const img_link   = "./send.png";
    return (
    <div>
      <div className="chatbox">
        <input type="text" placeholder='Type here' />
        <div className="send-icon">
            <img src={img_link} alt="Send" />
        </div>
      </div>
    </div>
  )
}

export default Chatbox
